import React from 'react';
import { ChevronLeft, ChevronRight, Plus } from 'lucide-react';

const Calendar = () => {
  const weekDays = ['Mon', 'Tues', 'Wed', 'Thurs', 'Fri', 'Sat', 'Sun'];
  const dates = [
    { day: '25', isGrayed: true },
    { day: '26', isCurrent: true },
    { day: '27' },
    { day: '28' },
    { day: '29' },
    { day: '30' },
    { day: '31' }
  ];

  const appointments = [
    {
      title: 'Dentist',
      time: '09:00-11:00',
      doctor: 'Dr. Cameron Williamson',
      type: 'dental',
      style: 'bg-indigo-600 text-white'
    },
    {
      title: 'Physiotherapy Appointment',
      time: '11:00-12:00',
      doctor: 'Dr. Kevin Djones',
      type: 'physio',
      style: 'bg-indigo-50 text-indigo-700'
    }
  ];

  return (
    <div className="p-4">
      {/* Header with Month and Navigation */}
      <div className="flex items-center justify-between mb-6">
        <h3 className="text-lg font-semibold text-gray-900">October 2021</h3>
        <div className="flex items-center space-x-2">
          <button className="p-1 rounded hover:bg-gray-100">
            <ChevronLeft className="w-5 h-5 text-gray-400" />
          </button>
          <button className="p-1 rounded hover:bg-gray-100">
            <ChevronRight className="w-5 h-5 text-gray-400" />
          </button>
        </div>
      </div>

      {/* Calendar Grid */}
      <div className="mb-6">
        {/* Weekdays */}
        <div className="grid grid-cols-7 mb-2">
          {weekDays.map((day) => (
            <div key={day} className="text-xs text-gray-500 font-medium text-center">
              {day}
            </div>
          ))}
        </div>

        {/* Dates */}
        <div className="grid grid-cols-7 gap-y-2">
          {dates.map((date, idx) => (
            <div key={idx} className="text-center">
              <span className={`inline-block text-sm py-1 w-8 rounded-full ${
                date.isGrayed ? 'text-gray-400' :
                date.isCurrent ? 'bg-indigo-600 text-white font-semibold' :
                'text-gray-900'
              }`}>
                {date.day}
              </span>
            </div>
          ))}
        </div>
      </div>

      {/* Time Slots Grid */}
      <div className="space-y-2">
        <div className="grid grid-cols-7 text-center">
          {['10:00', '08:00', '12:00', '10:00', '—', '12:00', '09:00'].map((time, idx) => (
            <div key={idx} className="text-xs text-gray-500">{time}</div>
          ))}
        </div>
        <div className="grid grid-cols-7 text-center">
          {['11:00', '09:00', '—', '11:00', '14:00', '14:00', '10:00'].map((time, idx) => (
            <div key={idx} className={`text-xs ${
              time === '09:00' ? 'text-white bg-indigo-600 rounded px-1' :
              time === '11:00' ? 'text-indigo-700 bg-indigo-50 rounded px-1' :
              'text-gray-500'
            }`}>{time}</div>
          ))}
        </div>
        <div className="grid grid-cols-7 text-center">
          {['12:00', '10:00', '13:00', '—', '16:00', '15:00', '11:00'].map((time, idx) => (
            <div key={idx} className="text-xs text-gray-500">{time}</div>
          ))}
        </div>
      </div>

      {/* Appointments */}
      <div className="mt-6 space-y-2">
        {appointments.map((apt, idx) => (
          <div key={idx} className={`${apt.style} p-3 rounded-xl`}>
            <div className="flex justify-between items-start">
              <div>
                <h4 className="font-semibold mb-1">{apt.title}</h4>
                <p className="text-sm opacity-90">{apt.time}</p>
                <p className="text-sm opacity-90">{apt.doctor}</p>
              </div>
              {apt.type === 'dental' && (
                <div className="w-8 h-8 bg-white bg-opacity-20 rounded-lg flex items-center justify-center">
                  <div className="w-4 h-5 bg-white rounded-t-full"></div>
                </div>
              )}
            </div>
          </div>
        ))}
      </div>

      {/* Action Buttons */}
      <div className="flex justify-end mt-4 space-x-2">
        <button className="p-2 bg-cyan-400 rounded-lg">
          <Plus className="w-5 h-5 text-white" />
        </button>
      </div>
    </div>
  );
};

export default Calendar;
